DROP TABLE IF EXISTS `post_messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `post_messages` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор поста или комментария',
  `communities_id` int unsigned NOT NULL COMMENT 'Ссылка на сообщество',
  `post_comment_id` int unsigned NOT NULL COMMENT 'Ссылка на пост или комментарий',
  `post_user_id` int unsigned NOT NULL COMMENT 'Ссылка на отправителя поста или комментария',
  `body` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст сообщения',
  `is_moderate` tinyint(1) DEFAULT '0' COMMENT 'Признак публикации модератором сообщества, True сообщение опубликовано',
  `count_like` int unsigned DEFAULT '0' COMMENT 'Счетчик лайков',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `IDX_POST` (`communities_id`,`post_comment_id`) COMMENT 'Индекс по сообществам и коментариям '
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сообщения в сообществах';
/*!40101 SET character_set_client = @saved_cs_client */;

